//hover on logic
boxArray.forEach((box) => {
    box.addEventListener("mouseover", () => {
        if (box.classList.contains("bisque")) {
            box.classList.add("yellowHover");
            box.classList.remove("bisque");
        }
        else if (box.classList.contains("yellowClick")) {
            box.classList.add("greenHover");
            box.classList.remove("yellowClick");
        }
    });
});

//hover off logic
boxArray.forEach((box) => {
    box.addEventListener("mouseout", () => {
        if (box.classList.contains("yellowHover")) {
            box.classList.remove("yellowHover");
            box.classList.add("bisque");
        }
        else if (box.classList.contains("greenHover")) {
            box.classList.remove("greenHover");
            box.classList.add("yellowClick")
        }
    });
});

//click logic
boxArray.forEach((box) => {
    box.addEventListener("click", () => {
        if (box.classList.contains("yellowHover") || box.classList.contains("bisque")) {
            box.classList.add("yellowClick");
            box.classList.remove("yellowHover", "bisque");
        }
        else if (box.classList.contains("greenHover") || box.classList.contains("yellowClick")) {
            box.classList.remove("greenHover", "yellowClick");
            box.classList.add("greenClick");
        }
        else if (box.classList.contains("greenClick")) {
            box.classList.remove("greenClick");
            box.classList.add("bisque");
        }
    });
});







